import React, { useState, useEffect } from 'react';
import { firebase } from '../firebase/config';
import { StyleSheet } from 'react-native';
import { useNavigation } from '@react-navigation/native';
import MapView, { Marker, PROVIDER_GOOGLE } from 'react-native-maps';


const Map = (props) => {

    let item = {
        name: "National park",
        imgURL: "https://cf.bstatic.com/data/xphoto/1182x887/324/32450911.jpg?size=S",
        userID,
        description: "This is very big park. It's amupark!!!",
        loacation: "Minsk, Belarus",
      }
    const navigation = useNavigation();
    var markers = [
        {
            latitude: 37.78825,
            longitude: -122.4324,
            title: 'Foo Place',
            subtitle: '1234 Foo Drive'
        }
    ];

    return (
        <MapView style={{ flex: 1 }} provider={PROVIDER_GOOGLE}
            showsUserLocationinitialRegion={{
                latitude: 37.78825,
                longitude: -122.4324,
                latitudeDelta: 0.0922,
                longitudeDelta: 0.0421,
            }}>
            <Marker
                key={10}
                coordinate={{ latitude: 37.78825, longitude: -122.4324 }}
                title={"report.location"}
                description={"sadads"} onPress={navigation.push("Detail"), {item}}/>
        </MapView>

    );
};
export default Map;

const styles = StyleSheet.create({

});
